import Head from "next/head";




const About = () => {
    const [ boolean, setBoolean ] = useState(false)
    const [ style, setStyle ] = useState({
        display: "none"
    });

    useEffect(() => {
        const setTheStyle = () => {
            setBoolean(true);
            setStyle({
                display: "flex"
            });
        };

        setTimeout(() => setTheStyle(), 2000);

    }, [])


    return (
        <>
            <Head>
                <title>about</title>
